let clockwise=true // Acts as a switch (if true: go anticlockwise, if false: go clockwise)

setInterval(()=>{ // Starts intervals
    if(clockwise){
    feature.rotation.y = feature.rotation.y + 100 // move anticlockwise
    clockwise = !clockwise
  }else{
    feature.rotation.y = feature.rotation.y - 100 // move clockwise
    clockwise = !clockwise
  }
},1500)

